import React from 'react'

function FriendRequests(freq) {
  let count = <h2>No Pending Requests</h2>;
  return (
    <div style={{display:"flex", alignItems:"center", justifyContent:"center", flexDirection:"column"}}>
      <h1>Friend Requests</h1>
      <div style={{border:"1px solid black", height:"650px", overflow:"scroll", borderRadius:"20px", width:"20vw", justifyContent:"center", display:"flex"}}>
        
        {count}
      </div>
    </div>
  )
}

export default FriendRequests
